# Alexeyevka, Aitovsky Selsoviet, Bizhbulyaksky District, Republic of Bashkortostan

}}
Alexeyevka () is a rural locality (a selo) in Aitovsky Selsoviet, Bizhbulyaksky District, Bashkortostan, Russia. The population was 187 as of 2010.
Geography
It is located 21&nbsp;km from Bizhbulyak and 182&nbsp;km from Ufa.
